import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './components/Navbar';  // Ensure this is inside the src/components directory
import Home from './pages/Home';          // Ensure this is inside the src/pages directory
import DepartmentPage from './pages/DepartmentPage'; // Ensure this is inside the src/pages directory
import AddEmployee from './pages/AddEmployee'; // Ensure this is inside the src/pages directory
import UpdateEmployee from './pages/UpdateEmployee'; // Ensure this is inside the src/pages directory
import './app.css'; // Make sure this CSS file is in src/

const App = () => {
  return (
    <Router>
      {/* Navbar Component (if you have a global navbar) */}
      <Navbar />

      <div className="app-container">
        <Routes>
          {/* Define your Routes here */}
          <Route path="/" element={<Home />} />
          <Route path="/departments" element={<DepartmentPage />} />
          <Route path="/add-employee" element={<AddEmployee />} />
          <Route path="/update-employee/:id" element={<UpdateEmployee />} />
          {/* You can add more routes for other pages */}
        </Routes>
      </div>
    </Router>
  );
};

export default App;
